import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import { deleteInstructor } from "../../store/actions/actionCreators";

const AllInstructorsView = (props) => {
  if (!props.allInstructors.length) {
    return <div>There are no instructors.</div>;
  }

  return (
    <div>
      {props.allInstructors.map((instructor) => {
        let name = instructor.firstname + " " + instructor.lastname;
        if(instructor.department==null){
          return(
            <div key={instructor.id}>
          <Link to={`/instructor/${instructor.id}`}>
            <h1>{name}</h1>
          </Link>

          <p>Department: N/A</p>
          <button  onClick={deleteInstructor({instructor,id})}>Delete Instructor Above</button>

        </div>
          )
        }
        return (
          <div key={instructor.id}>
          <Link to={`/instructor/${instructor.id}`}>
            <h1>{name}</h1>
          </Link>

          <p>Department: {instructor.department}</p>
          <button>Delete Instructor Above</button>

        </div>
        );

      })}
    </div>
  );
};

AllInstructorsView.propTypes = {
  allInstructors: PropTypes.array.isRequired,
};

export default AllInstructorsView;
